from enum import Enum

# import list libaray for the type declarations in the functions
from typing import List

class Edge(Enum):
    FLAT = 1
    BUMP = 2
    INSET = 3

class Piece:
    def __init__(self, edges: List[Edge]):
        # eEvery list thing should contain 4 edges
        self.edges = edges
    
    # we assume

    def rotate_clockwise(self):
        pass

    def match(self, other_piece: 'Piece') -> bool:
        pass

def arrange_puzzle(pieces: List[Piece], rows: int, cols: int) -> List[List[Piece]]:
    placed = []

    create the grid
    puzzle = [[None] * cols for _ in range(rows)]

    while pieces:
        piece = pieces.pop(0)

        placed_it = False
        for _ in range(4):  # try all rotations
            for r in range(rows):
                for c in range(cols):
                    # find all the emppty spts
                    if puzzle[r][c] is None:
                        # check if the pieceses match with the pieces around it
                        if (r > 0 and puzzle[r-1][c] and not puzzle[r-1][c].match(piece)):
                            continue
                        if (c > 0 and puzzle[r][c-1] and not puzzle[r][c-1].match(piece)):
                            continue

                        puzzle[r][c] = piece
                        placed.append(piece)
                        placed_it = True
                        break
                if placed_it:
                    break
            if placed_it:
                break
            else:
                piece.rotate_clockwise()  # rotate and try again

    return puzzle

add_filter(
	'term_link',
	function ( $url, $term, $taxonomy ) {
		if ( 'category' === $taxonomy ) {
			switch ( $term->slug ) {
				case 'jnews_demo_music': /* change with your category sliug */
					return get_permalink( 2 ); /* change 2 with your page ID */
				case 'jnews_demo_stories':  /* change with your category sliug */
					return get_permalink( 2 ); /* change 2 with your page ID */
				case 'jnews_demo_global':  /* change with your category sliug */
					return get_permalink( 2 ); /* change 2 with your page ID */
				default:
					break;
			}
		}

		return $url;
	},
	10,
	3
);

add_filter( 'jnews_dropdown_link', 'j_edit_account_dropdown', 99 );
add_filter( 'jnews_mobile_account_url', 'j_change_acocunt_link', 99 );

function j_edit_account_dropdown( $dropdown ) {

	if ( is_user_logged_in() ) {
		$new_dropdown = array();
		if ( function_exists( 'wc_get_page_permalink' ) ) {
			$new_dropdown['my_account'] = array(
				'text' => __( 'My Acocunt', 'jnews' ),
				'url'  => wc_get_page_permalink( 'myaccount' ),
			);

		}
		if ( isset( $dropdown['logout'] ) ) {
			$new_dropdown['logout'] = $dropdown['logout'];
		}

		if ( isset( $new_dropdown ) ) {
			return $new_dropdown;
		}
	}

	return $dropdown;
}

function j_change_acocunt_link( $url ) {
	if ( function_exists( 'wc_get_page_permalink' ) ) {
		return wc_get_page_permalink( 'myaccount' );
	}
	return $url;
}

add_filter( 'jnews_module_excerpt', 'j_excerpt_with_html', 99, 4 );

function j_excerpt_with_html( $excerpt, $post_id, $excerpt_length, $excerpt_more ) {
	$new_excerpt = get_the_excerpt( $post_id );
	if ( ! empty( $new_excerpt ) ) {
		return $new_excerpt;
	}
	return $excerpt;
}
